from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message


from stw_gen_sample3_api.types.core.time.ms_6_4u_type import ms64u


@dataclass
class OperatingTimeInfo(_Message):

    # Количество перезагрузок прибора
    rebootCount: uint32_t
    # Время работы с последнего включения прибора
    fromRebootTime: ms64u
    # Общее время работы прибора
    totalTime: ms64u


class OperatingTimeInfoDict(TypedDict):

    # Количество перезагрузок прибора
    rebootCount: Union[uint32_t, int ]

    # Время работы с последнего включения прибора
    fromRebootTime: Union[ms64u]

    # Общее время работы прибора
    totalTime: Union[ms64u]

